import React, { Component } from 'react';


class Text extends Component{
    constructor(name,job){
        this.name = 'سلطان';
        this.job = 'مطور ويب';
    }
    render(){
        return (
            <div>
                <p>{`مرحباً يا ${this.name} وظيفتك هي ${this.job}`}</p>
            </div>
        )
    }
}
export default Text;
